import './App.css';
import { createBrowserRouter,Outlet, RouterProvider, ScrollRestoration } from 'react-router-dom';

function App() {
  const router = createBrowserRouter([
    {
      path:'/',
      element: <Layout/>,
      children:[
        {
          path: '/',
          element: <Home/>,
          loader: productsData
        },
        {
          path:'/product/:id',
          element: <Product/>
        },
        {
          path: '/cart',
          element: <Cart/>
        },
        {
          path: '/login',
          element: <Login/>
        }
      ]
    }
  ]) 

  return (
    <div className="App">
           <RouterProvider router={router}/>
    </div>
  );
}

export default App;
